(6, 'Diabetes mellites type-2.', 'metformin 500mg oral tds and atorvastatin 10mg oral daily.', '160', 1, '50', '19.53', '2017-08-14', 'Dr.Sutharsan (consultant General surgeon)', 'Lower back pain and neck pain of 1 month duration.\r\n', 'N/A', NULL, 'Not known.', NULL, '', '', 'C5/C6, C6/C7 disc\r\nL5/S1 disc', '', NULL, NULL, NULL, NULL, 'Degenerative disease of cervical and lumbar spine.', 'Gabapentin 300mg oral bad for 1 month.', '', 'Review with x-ray spine. Need new MRI. Physiotherapy. Analgesics. Review in 6 weeks.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-12 04:54:12', '2017-10-30 02:22:00'),
(7, 'Nil', 'Nil', '', 1, '', '0', '2017-08-21', '', 'Lower back pain of 1 year duration, pain radiates to left lower limb and numbness at lower limb.', 'Total abdominal hysterectomy and bilateral salpingo-oophorectomy.', NULL, 'Not known.', NULL, '', '', 'Retrolisthesis of L4 over L5 with grade 1 severity. Broad based posterior disc bulge with retrolisthesis causing spinal canal stenosis and cauda equina compression with bilateral inter vertebral foraminal stenosis associated with bilateral nerve root compression at L4-L5 level.\r\nPosterior disc bulge with bilateral inter vertebral foraminal stenosis and bilateral nerve root compression at L5 and S1 level.', '', NULL, NULL, NULL, NULL, 'Degenerative disease of lumbar spine.', 'Gabapentin 300mg oral bd for 1 month, tramadol 50 mg oral bd for 1 month and domperidone 10mg Ora TDs for 1 month.', 'Surgery date is on 25/01/2018.', 'Analgesics and physiotherapy.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-12 05:23:52', '2017-10-30 03:27:19'),
(8, '[""]', 'Metformin 750mg oral bd and gliclazide 40mg oral bd.', '162', 1, '58.1', '22.14', '2017-08-14', 'Medical professorial unit.', '[""]', 'Warts removal and abscess I & D were done.', NULL, '[""]', NULL, '', 'Indentation seen at L1/L2, T12/L1 and T11/T12 level. L1-L2 level posterior disc prolapse causing canal stenosis and bilateral L2 nerve root compression. L5-S1 level facet joint hypertrophy seen but no canal stenosis.', '', '', NULL, NULL, NULL, NULL, '[""]', 'Gabapentin 300mg oral bd for 1 month.', '', 'Need MRI whole spine. Analgesics.', NULL, '', '', '', NULL, '', '', '', '', '[""]', '2017-09-12 05:49:53', '2018-05-06 08:29:12'),
(9, '[""]', 'Atenolol 50mg oral noct, enalapril 5mg oral bd and asprin 1tab oral noct.', '171', 1, '75', '25.65', '2017-08-21', 'Dr.K.Ajantha (Consultant Nerologist).', '[""]', 'Haemorrhoidectomy and lump excision from left thigh were done.', NULL, '["Not known"]', NULL, 'Degenerative changes.', '', 'Multi level canal stenosis; \r\nL2-S1\r\nL4/L5 ', '', NULL, NULL, NULL, NULL, '[""]', 'Gabapentin 300mg noct for one month and paracetamol 1g tds for one month.', '', 'X-ray dynamic views. Physiotherapy. Analgesics. Review in 6 weeks.', NULL, '', '', 'Yes', 'No', 'No', '', '', '', '[""]', '2017-09-18 02:26:15', '2018-08-27 06:33:12'),
(10, '["Diabetes mellitus"]', 'Metformin 1g oral bd, gliclazide 40mg mane and atorvastatin 10mg oral noct.\r\n', '168', 1, '72', '25.51', '2017-08-01', 'Dr.A.Arasalingam (Consultant Nerologist).', '["Lower back pain","Others"]', 'N/A', NULL, '["Not known"]', NULL, '', 'CT Myelogram;\r\nAlignment and height are normal. Early degenerative changes noted involving L5/S1, with posterior marginal osteophytes and disc herniation noted at that level. Possible right side exciting foramina narrowing at L5/S1 level.', '', '', NULL, NULL, NULL, NULL, '[""]', 'Gabapentin 300mg oral bd for one month.', '', 'Plan for MRI morbid spine. Analgesics. Physiotherapy. Review in 3 months.\r\n\r\n', NULL, '', '', 'No', 'No', 'No', '', '4', '', '[""]', '2017-09-18 03:04:16', '2018-06-25 04:30:50'),
(11, 'Bronchial asthma, ischemic heart disease-heart failure, hypertension and hypothyroidism.', 'Thyroxine 20microgram oral daily, atorvastatin 20mg oral noct, ISMN 60mg oral mane, losartan 25mg oral bd, dilatazem 30mg oral bd, furosemide 20mg oral bd, KCl 1tab oral daily, beclometasone MDI and asthalin MDI. \r\n\r\n', '153', 1, '68.6', '29.3', '2017-08-28', 'Orthopaedic clinic.', 'Lower back pain of one year duration. Bilateral lower limb numbness. No bladder or bowel incontinent. ', 'Appendectomy was done.', NULL, 'Not known.', NULL, '', '', '12/04/2017:\r\nDiffuse annular disc herniation at L3/L4.\r\nGrade 1 anesthesiologists at L4 and L5.\r\n', '', NULL, NULL, NULL, NULL, 'Degenerative disease of lumbar spine.', 'Gabapentin 300mg oral bd for 2 weeks and paracetamol 1g oral sos for 2 weeks.', 'Discectomy and cage fusion. Preoperative investigations was done(28/0/2017). Anaesthetic referral was done . High risk of perioperative cardiovascular and respiratory events due to TVD and uncontrolled bronchial asthma. Patient wants to discuss with family. Review in 2 weeks.\r\n\r\n', 'Analgesics.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-18 04:30:54', '2017-10-30 02:46:20'),
(12, 'Hypertension and osteoporosis.', 'Losartan 50mg oral bd, methyldopa 25mg oral noct, alendronate 70mg weekly, HCT 25mg oral mane and Super cal 1g oral daily.\r\n', '148', 1, '56.5', '25.79', '0000-00-00', 'Dr.Ketheeswaran (Consultant Physician).', 'Difficulty in walking of 5 year duration.', 'N/A', NULL, 'Not known.', NULL, '', '', 'MRI (NCH) 01/03/2017\r\nSmooth disc osteophyte complex and ligamentum flavum hypertrophy causing severe spinal stenosis and severe cord compression with myelopathic changes with bilateral intervertebral foramen stenosis. But no nerve root compression at C3-C4, C4-C5 and C5-C6 level(cervical myelopathy)', '', NULL, NULL, NULL, NULL, 'Degenerative disease of cervical spine.', '', 'Need laminoplasty. Preoperative investigation done. Review in one month.\r\n', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-18 05:12:32', '2017-10-30 02:48:03'),
(13, 'Nil', 'Nil', '171', 1, '55.6', '19.01', '2017-08-28', '', 'Accidental fall of heavy object on neck. No weakness or numbness.', 'N/A', NULL, 'Not known.', NULL, '', 'Atlanto axial subluxation. Suspicious of bilateral base of the skull fracture at the side of suture line.\r\n', '', '', NULL, NULL, NULL, NULL, 'Trauma of cervical spine.', 'Paracetamol 1g oral sos - 30 tabs.', 'Review in 3 weeks with collar.', 'Analgesics.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-18 05:46:57', '2017-10-30 02:49:01'),
(14, 'Ischemic heart disease, diabetes mellitus, hypertension and road traffic accident (Epidural hemorrhage, Subarachnoid hemorrhage with frontal bone fracture).', 'Aspirin 75mg oral noct, atorvastatin 10mg oral noct, diltiazem 30mg oral tds metformin 500mg oral bd, gliclazide 40mg oral noct, losartan 25mg oral noct, beclomethasone  200microgram MDI bd and asthalin 200microgram MDI bd.', '150', 1, '48', '21.33', '2017-08-17', 'Dr.S.Garusinghe', 'Difficulty in walking of 2 year duration. History of trauma 2015/11/26. Need support for ADLs.', 'Tracheotomy was done.', NULL, 'Not known.', NULL, '', 'Brain CT :- Subarachnoid hemorrhage and epidural hemorrhage.', 'C4  level canal contusion and C3-C6 canal stenosis.', '', NULL, NULL, NULL, NULL, 'Degenerative disease of cervical spine and trauma.', 'Gabapentin 300mg oral bd for 2 weeks.', 'C3-C6 fusion and decompression. Need lateral mass fixation. Review with X-ray. Pre-operative assessment.\r\n', 'Analgesics.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-19 03:16:01', '2017-10-30 02:42:21'),
(15, 'Diabetes mellitus, hypertension and hyperlipidemia.', 'Enalapril 5mg oral bd, gliclazide 40mg oral bd and metformin 1g oral bd.\r\n', '151', 1, '69.6', '30.52', '2017-08-21', 'VP from Thellipalai.', 'Lower back pain of 5 years duration radiating to left leg. Numbness is also present.', 'Lower segment cesarean section and ligation and dissection of tube were done.', NULL, 'Not known.', NULL, 'L4/L5 degenerative spondylolisthesis.', '', '', '', NULL, NULL, NULL, NULL, 'Degenerative disease of lumbar spine.', 'Gabapentin 300mg oral bd for 1 month, diclofenac sodium 50mg oral bd for 1 month and omeprazole 20mg oral bd for 1 month.', 'Lumbo sacral corset. Need MRI. Review in 6 week.', 'Physiotherapy and analgesics.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-19 03:20:13', '2017-10-30 02:44:26'),
(16, 'Hypertension, dyslipidemia and diabetes mellitus type-2.\r\n\r\n', 'Metformin 500mg oral tds, gliclazide 40mg oral bd, enalapril 5mg oral mane, atorvastatin 5mg oral noct and Vit B.co 1tab oral daily.', '157', 1, '85.5', '34.69', '2017-08-21', 'Dr.P.Srigrishna (Consultant orthopaedic surgeon).', 'Lower back pain radiating to right lower limb of 6 month duration.', 'Left side carpal tunnel decompression was done 10 years back.', NULL, 'Not known.', NULL, '', '', 'Degenerative disc disease (cervical and lumber spine facet joint arthritis spondylitis).', '', NULL, NULL, NULL, NULL, 'Degenerative disease of cervical and lumber spine.', 'Gabapentin 300mg oral bd for 1 month, domperidone 10mg oral tds for 1 month and ciprofloxacin 500mg oral bd for 1 week.', 'Lumbo sacral corset and need consultant orthopedic surgeon opinion.', 'Analgesics and physiotherapy.\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-25 02:29:07', '2017-10-30 02:29:46'),
(17, 'N/D', 'N/D', '152', 1, '61', '26.4', '2017-08-29', 'Orthopaedic clinic.', 'Lower back pain of 3 month duration.\r\n', 'Lower segment cesarean section was done.', NULL, 'Not known.', NULL, '', 'Atypical haemangioma and mild collapse of L2 vertebra. No vertebral body collapsed. No significant canal stenosis. Rest of the vertebral body appear normal. ', 'Mild acute collapse of L2 vertebral body due to underlying atypical haemangioma. Diffuse disc bulge and bilateral facet ligamentum flavum hypertrophy at L3/L4, L4/L5 and L5/S1 causing indentation of thecal sac and bilateral neural foraminal narrowing.', '', NULL, NULL, NULL, NULL, 'Atypical haemangioma and mild collapse of L2 vertebra.', 'Paracetamol 1g oral sos, diclofenac sodium 50mg oral bd for 2 weeks and omeprazole 20mg oral bd for 2 weeks.', 'Refer to Dr. Anton Jenil, consultant radiologist for absolute alcohol injection.', 'Analgesics and physiotherapy.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-25 02:55:13', '2017-11-07 03:03:23'),
(18, 'Hypertension.', 'Amlodipin 5mg oral bd and hydrochlorothiazide 25mg oral mane.', '', 1, '', '0', '2017-08-29', '', 'Neck pain of 8 month duration.', 'N/D', NULL, 'Not known.', NULL, '', '', 'Posterior disc osteophytes at C3/C4,C4/C5,C5/C6 and C6/C7 levels encroaching into the intervertebral foreman causing severe compression of nerve roots in exit foreman. No significant cord compression. Chronic posterior disc protrusions at L3/L4, L4/L5 and L5/S1 levels with associated thickening of ligamenta flava causing mild compression of L4 nerve roots at L3/L4 level, L5 nerve roots at L4/L5 level and S1 nerve roots at L5/S1 levels.', '', NULL, NULL, NULL, NULL, 'Cervical spondylosis with Myelopathy.', 'Gabapentin 300mg oral bd for 1 month.', 'Anterior cervical discectomy and fusion.', 'Review in 3 months.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-25 03:17:48', '2017-10-30 02:54:44'),
(19, 'N/D', 'N/D', '169', 1, '52.6', '18.42', '2017-09-11', '', 'Lower back pain and unsteady gait of 1 year duration.', 'Spinal surgery was done under general anesthesia 25 years back. ', NULL, 'History of drug and food allergy. ', NULL, '', 'L4/L5 degeneration and right side L4 root compression.', '', '', NULL, NULL, NULL, NULL, 'Degenerative disease of lumbar spine.', 'Gabapentin 300mg oral bd for 1 month.', '', 'Analgesics, need MRI and review with MRI.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-25 03:30:06', '2017-10-30 02:57:45'),
(20, 'Ischemic heart disease and hypertension.', 'Diltiazem 50mg oral tds, clopidogrel 75mg oral noct, atorvastatin 5mg oral noct and calcivita 1tab oral daily.', '148', 1, '50.7', '23.15', '2017-09-11', '', 'Neck trauma due to accident fall.', 'L3/L4 laminectomy was done under general anesthesia 28 years back.', NULL, 'History of food allergy.', NULL, '', '', '25/7/2017\r\nDegenerative of changes of entire spine . Atlanto axial subluxation with spinal canal stenosis. No significant compression of spinal cord. There had been laminectomy L3 and L4 vertebrae. ', '', NULL, NULL, NULL, NULL, 'Atlanto axial subluxation.', 'Gabapentin 300mg oral bd for 3 weeks.', 'Plan for surgery.', 'Analgesics and review in 3 weeks.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-25 03:43:17', '2017-10-30 03:00:43'),
(21, 'Hyperlipidemia.', 'Atorvastatin 10mg oral noct.', '151', 1, '51', '22.37', '2017-09-18', 'Dr.T.Kumanan (consultant physician).', 'Lower back pain of 1 year duration. Right side leg numbness.', 'N/A', NULL, 'Not known.', NULL, '', '', 'L4/L5 level tear in annulus fibrosus healed with granulation tissue central disc herniation impinges on both exiting nerve roots. L5/S1 level central disc herniation impinges on both exiting nerve roots. Disc herniations at L4/L5 and L5/S1 levels.', '', NULL, NULL, NULL, NULL, 'Degenerative disease of lumbar spine.', 'Gabapentin 300mg oral bd for 1 month, diclofenac sodium 50mg oral bd for 1 month and omeprazole 20mg oral bd for 1 month.', '', 'Need consultant orthopedic surgeon opinion, analgesics, physiotherapy and review in 1 month.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-25 04:03:23', '2017-10-30 03:02:42'),
(22, '[""]', 'Atorvastatin 20mg oral noct, prazosin 0.5mg oral tds, amitriptyline 12.5mg oral noct and vit c 1tab oral tds.', '164', 1, '65.3', '24.28', '2017-08-15', 'Dr.A.Arasalingam (Consultant Nerologist).', '[""]', 'L4/L5 laminectomy was done at 2002. Left side monophegic type weakness in 2005. Revision surgery was done.\r\n\r\n', NULL, '["Not known"]', NULL, '', 'CT whole spine height of thoracic lumber vertebra are normal. Evidence of surgery at L4/L5 level. Loss of disc height C4/C5 and C5/C6 intervertebral disc space. No canal stenosis.', '', '', NULL, NULL, NULL, NULL, '[""]', '', 'Consultant orthopaedic surgeon seen. Need MRI whole spine. Review in 2 month with new MRI.', '', NULL, '', '', '', '', '', '', '', '', '[""]', '2017-09-26 03:10:37', '2018-07-30 03:03:12'),
(23, 'Bronchial asthma.', 'Beclomethasone 200 micro gram MDI bd and asthalin 200 micro gram MDI sos.', '151', 1, '79.6', '34.91', '0000-00-00', 'Dr.P.Srigrishna (consultant orthopaedic surgeon).', 'Lower back pain of 4 year duration. No radiation and no numbness.', '3 lower segment cesarean section and varicose vein surgery were done.', NULL, 'Not known.', NULL, '', '', 'Early cervical spondylosis with left exiting nerve root at c3/c4 level. Mildly exaggerated lumbar lordosis with features suspicions of bilateral spondylosis of L5. L4-L5 diffuse disc bulge indenting bilateral traversing nerve roots. L5/S1 diffuse disc bulge and posterior herniation indenting thecal sac and left exiting nerve root. Features of posterior annular tear at both above levels.', '', NULL, NULL, NULL, NULL, 'Degenerative disease of cervical and lumbar spine.', '', 'Consultant orthopaedic surgeon seen. L4 S1 fusion and decompression.\r\nPre-operative assessment;\r\n-Full blood count\r\n-Blood urea, serum creatinnine and serum electrolytes\r\n-Fasting blood sugar\r\n-PT/INR\r\n-Chest X-ray\r\n-ECG\r\n-Cardiologist referral \r\n- Anesthesia referral \r\n', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-09-26 03:34:42', '2017-10-30 02:56:39'),
(24, 'Bilateral cervical rib, ischemic heart disease, transient ischemic attack and dyslipidemia.', 'Baclofen 5mg -7.5mg-5mg and amitriptyline.', '', 1, '', '0', '2017-10-02', 'Dr.Ajantha (consultant neurologist).', 'Spastic paralysis of one month duration s urinary and has urinary incontinent. \r\n', 'N/A', NULL, 'Not known.', NULL, 'Bilateral cervical spine.', '', 'Loss of normal cervical lordosis C5-C6, C6-C7 and C7-T1 disc space narrowing is more marked at C6-C7. Disc osteophyte at the above levels causing bilateral exit foramen with canal stenosis and cord compression with myelopathic changes at C5/C6 and C6/C7. Modic type -2 changes at the adjacent cervical vertebral bodies. T6 vertebral body haemagioma. L3, L4 right paracentral dissc bulge causing mild right exit foramen stenosis.\r\nL4,L5 reduction of disc height broad disc bulge with inferior migration causing canal stenosis and bilateral exit foramen stenosis . Modic 2 changes in the adjacent vertebral bodies.\r\nL5,S1 broad disc bulge with inferior migration causing canal stenosis and bilateral exit foramen stenosis. No para vertebral soft tissue masses.', '', NULL, NULL, NULL, NULL, 'Degenerative disease of lumbar spine.', '', 'Orthopaedic surgeon opinion needed.', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-10-02 05:45:46', '2017-10-30 03:04:26'),
(25, 'Nil', 'Nil', '165', 1, '58', '21.3', '2017-10-02', 'Dr.T.Peranantharajah (consultant physician).', 'Bilateral lower limb flaccid paralysis of 2 year duration. No urinary incontinence and bowel incontinence. Numbness in bilateral feet. ', 'Right side herniotomy and cataract surgery were done.\r\n', NULL, 'Not known.', NULL, '', '', 'Ligamentum flavum from L1-S1 level. Spinal canal stenosis and cauda equina compression at L3-L4 and L4-L5 level. Bilateral intervertebral foramen stenosis and left side nerve root compression at L4-L5 level.', '', NULL, NULL, NULL, NULL, 'Degenerative disease of lumbar spine.', 'Paracetamol 1g oral sos 30 tablets, tramadol 50mg oral bd for one month, domperidone 10mg oral tds for one month and MSLA.', 'Need long fusion L2-S1. Transpedicular screw and decompression.', 'Analgesics.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-10-16 01:53:30', '2017-10-30 02:47:13'),
(26, '["Hypertension"]', 'Amlodipine 5mg oral bd and atorvastatin 20mg oral noct.', '147', 1, '83', '38.41', '2017-10-02', 'Orthopaedic clinic.', '["Lower back pain","Lower limb numbness"]', 'Left side total knee arthroplasty and bilateral ligation and resection of tubes were done.', NULL, '["Not known"]', NULL, '', '', '', '', NULL, NULL, NULL, NULL, '[""]', 'Tramadol 50mg oral bd for one month, domperidone 10mg oral tds for one month and paracetamol 1g oral sos 30 tablets.', 'Pre-operative assessment was done. surgery L4-L5 transforaminal lumbar interbody fusion. Date for surgery is at 16/12/2017. Review in 2 month.', 'Analgesics.', NULL, 'Open', 'TLIF', 'No', 'Yes', 'No', '3', '', '', '["L4","L5"]', '2017-10-16 02:32:54', '2018-06-25 04:38:15'),
(27, 'Nil', 'Nil', '164', 1, '49.2', '18.29', '0000-00-00', '', 'Lower back pain and bilateral foot drop.', 'N/A', NULL, 'Not known.', NULL, '', '', 'Lumbar spondylosis with broad based disc herniation most marked at L4-L5 level causing canal stenosis cauda equina compression and bilateral root compression. Cervical spondylosis with disc osteophyte formation more marked at C5-C6 causing thecal indentation and left side root compression.', '', NULL, NULL, NULL, NULL, 'Degenerative disease of lumbar and cervical spine.', 'Gabapentin 300mg oral bd for 2 weeks and paracetamol 1g oral sos 20 tablets.', 'Transforaminal lumbar interbody fusion at L4-L5. Plan for surgery on 07/10/2017.', 'Analgesics.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-10-16 02:51:02', '2017-11-06 03:08:52'),
(28, 'Dyslipidemia.', 'Atorvastatin 10mg oral noct.', '153', 1, '59.5', '25.42', '2017-10-09', 'Orthopaedic clinic.', 'Lower back pain of 2 year duration. Pain radiates to right leg and numbness is also present.', 'Total abdominal hysterectomy and  bilateral salpingo-oophorectomy was done.', NULL, 'Not known.', NULL, 'Degenerative changes are present.', '', 'There is L3/L4, L4/L5 and L5/ broad based disc bulges causing thecal sac compression and bilateral lateral recess and exit foraminal narrowing more marked at L5/S1 level. L1,L2 and L3 vertebral body anterior wedge fractures seen. Vertebral bodies are normal height and alignment. No evidence of disc protrusions. No paravertebral soft tissue masses seen. No intramedullary or extramedullary lesion within the spinal canal.', '', NULL, NULL, NULL, NULL, '', 'Tramadol 50mg oral bd for 1 month and domperidone 10mg oral tds for one month.\r\n', 'Consultant orthopaedic surgeon opinion for transpedicular screw and decompression. Consultant orthopaedic surgeon opinion:- Facet joint arthritis and loss of lumbar lordosis, plan for dynamic x-ray: left side spine anteroposterior and lateral view on standing position. Review in 2 weeks.', 'Analgesics, physiotherapy and lumber corset.\r\n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2017-10-16 03:24:40', '2017-10-30 03:05:55'),
