(6, 26, 'Transforaminal lumbar interbody fusion.', NULL, NULL, 'Transforaminal lumbar interbody fusion under general anesthesia was done by Dr.Srigrishna (Consultant orthopedic surgeon), Dr.Tishanthan (Register) and Dr.Andru (Register).\r\n- Posterior approach.\r\n-L4-L5 identify under X-ray image intensifier.\r\n-Transpedi', '', '-Oral antibiotics.\r\n-Analgesics.\r\n-Mobilization with corset.\r\n-Review in orthopedic spine clinic 10 days.', '2017-10-20', '2017-10-26', '2017-10-29', '2017-11-07 02:56:52', '2017-11-07 02:56:52'),
(8, 30, 'Epidural injection', NULL, NULL, 'Epidural marcain and dexamethasone was given by Dr. Sivathasan.', '', 'Review in orthopedic spinal clinic in one month and analgesics.', '2017-11-15', '2017-11-15', '2017-11-17', '2017-12-19 03:12:41', '2017-12-19 03:12:41'),
(9, 58, 'T5-T6-T12 laminectomy + decompression.', NULL, NULL, 'T5-T6-T12 laminectomy + decompression done on 27.01.2018 and 08.02.2018 by Dr.P.Srigrishna (consultant orthopedic surgeon), Dr.Tishanthan (Register) and Dr.Ushiyanthan (Mo). \r\nProne position, posterior approach, T5-T12 identified under II. Laminectomy a', '', 'Review on 22.02.2018.\r\n\r\n22.02.2018:- post operative 3 weeks. wound is healthy. Plan for continue physiotherapy and review in 3 weeks with x-ray.', '2018-01-15', '2018-01-27', '2018-02-12', '2018-02-27 03:25:59', '2018-02-27 04:30:14'),
(10, 67, 'Scoliosis correction', NULL, NULL, 'Scoliosis correction surgery under general anesthesia. Thoracic scoliosis correction was done by Dr.P.Srigrishna (consultant orthopedic surgeon), Dr.P.Tishanthan (register) and Dr.Thileepan (register). Prone position, posterior approach, T2-L2 identify un', '', 'Oral antibiotics, analgesics, mobilication with thoracolumbar corset and review in orthopedic spinal clinic in one month. ', '2018-02-12', '2018-02-15', '2018-02-21', '2018-02-27 04:43:57', '2018-02-27 04:56:07'),
(11, 59, 'Scoliosis correction', NULL, NULL, '', '', 'Review in orthopedic spinal clinic in 3 weeks. ', '2017-12-09', '2017-12-10', '2017-12-12', '2018-03-06 04:12:24', '2018-03-06 04:13:08'),
(12, 59, 'Scoliosis corrective surgery.', 'on', NULL, 'Scoliosis corrective surgery under general anesthesia done by Dr. P.Srigrishna, Dr.T.Gobyshankar, Dr.P.Tishanthan and Dr.Andrew.\r\nProne position. Posterior approach. Superficial and deep muscle dissection done. Paraspinal muscle elevated. Pedicular screw ', 'Nil', 'Antibiotics and analgesics. Review in orthopedic spinal clinic for wound inspection. Full weight bearing mobilization with thoracolumbar corset. ', '2018-01-15', '2018-01-18', '2018-01-26', '2018-03-06 04:28:17', '2018-03-06 04:28:17'),
(13, 16, 'Surgery was postponed. ', NULL, NULL, '', '', 'Review in orthopedic spinal clinic in one month.', '2018-02-26', '0000-00-00', '2018-02-26', '2018-03-27 02:44:25', '2018-03-27 02:44:25'),
(14, 28, 'Surgery not done due to not available OT/ICU', NULL, NULL, '', 'Request admission for C1C2 subluxation fusion and reduction ', 'Readmit on 31/03/2018', '2018-01-16', '0000-00-00', '2018-03-24', '2018-05-28 03:38:24', '2018-05-28 03:40:22'),
(15, 28, 'C1-C2 Fixation done under general anesthesia. ', NULL, NULL, 'Posterior approach. \r\nMidline incision.\r\nTwo lateral mass screw fixed with C1.\r\nTwo lamina screw fixed with C2\r\nFixation done.\r\nIliac bone graft applied. \r\nRoutine clossmodom.\r\nSkin clipped. ', 'Nil', 'Antibiotic.\r\nAnalgesic.\r\nPhysiotherapy.\r\nReview in clinic in 1 month.\r\n', '2018-03-31', '2018-04-09', '2018-04-22', '2018-05-28 04:04:16', '2018-05-28 04:04:16'),
(16, 122, 'C4-C6 Spinal decompression and Laminoplasty done under general anesthesia ', NULL, NULL, 'Midline incision made \r\nLamina C4-C6 mobilized -laminoplasty done.\r\nFixed with plate and screw.\r\nHaemostanie done.\r\nRoutine closer done. \r\nSkin clipped. \r\nAnalgesic, I.V antibiotic for day 12\r\nICU care for 8 days. \r\nClipped removed day 13.\r\nCervical colla', 'Urinary tract infection ', 'Oral antibiotic, Oral Analgesic, Continu physiotherapy, Keep cervical collar, Review in spinal clinic in 2 weeks.  ', '2018-04-23', '2018-05-14', '2018-05-27', '2018-06-04 04:30:08', '2018-06-04 04:30:08'),
(17, 89, 'Minimal invasive L3-L4 TLIF + Discectomy + Loge fusion under GA', NULL, NULL, '', '', 'Review in clinic 2 weeks. Antibiotic. Analgesics ', '2018-04-07', '0000-00-00', '2018-04-15', '2018-06-25 04:48:27', '2018-06-25 04:48:27'),
(18, 112, 'Revision TPS fixation under GA ', NULL, NULL, 'investigated for failed implant \r\nposterior approach through previous scar\r\nFailed implant revision\r\nRevision done with L4 S1 screw \r\nSkin clipped \r\n', '', 'Continue antibiotic \r\nAnalgesic  \r\nReview in 1 week ', '2018-07-30', '2018-08-04', '2018-08-10', '2018-08-20 04:00:09', '2018-08-20 04:00:09'),
(19, 183, 'L4/L5 TPS fixation and L4 laminectomy ', NULL, NULL, 'Posterior mid line approach, Vertebral identified, TPS fixation L4/L5 level, L4 laminectomy done, Haemostasis  achieved, Skin clipped    ', 'No complication', 'Oral Analgesia, Oral antibiotic, Review in OC clinic 1 weeks ', '2018-09-10', '2018-09-18', '2018-09-23', '2018-10-01 03:20:45', '2018-10-01 03:20:45');
